import React, { useContext } from "react";
import { ChevronLeft, ChevronRight, Sun, Moon, Share } from "lucide-react";
import { AuthContext } from "../../Context/AuthContext";

const Header = ({
  darkMode,
  setDarkMode,
  sidebarCollapsed,
  setSidebarCollapsed,
}) => {
  const { user } = useContext(AuthContext);

  // Function to get user's initial
  const getUserInitial = () => {
    if (user) {
      if (user.name) return user.name.charAt(0).toUpperCase();
      if (user.email) return user.email.charAt(0).toUpperCase();
    }
    return "U"; // Default if no user data
  };

  // Function to generate a consistent color based on user's email
  const getUserColor = () => {
    if (!user || !user.email) return "bg-blue-500";

    const hash = user.email.split("").reduce((acc, char) => {
      return char.charCodeAt(0) + ((acc << 5) - acc);
    }, 0);

    const colors = [
      "bg-blue-500",
      "bg-green-500",
      "bg-purple-500",
      "bg-red-500",
      "bg-yellow-500",
      "bg-pink-500",
      "bg-indigo-500",
      "bg-teal-500",
    ];

    return colors[Math.abs(hash) % colors.length];
  };

  // Get user's display name
  const getDisplayName = () => {
    if (user) {
      if (user.name) return user.name;
      if (user.email) return user.email.split("@")[0];
    }
    return "User";
  };

  return (
    <header
      className={`border-b ${
        darkMode ? "border-gray-700 bg-gray-800" : "border-gray-200 bg-white"
      } py-2 px-4 flex items-center justify-between sticky top-0 z-10`}
    >
      {/* Left side - Collapse button */}
      <div className="flex items-center">
        <button
          onClick={() => setSidebarCollapsed(!sidebarCollapsed)}
          className={`p-1.5 rounded-full ${
            darkMode ? "hover:bg-gray-700" : "hover:bg-gray-100"
          } transition-colors duration-200`}
          aria-label={sidebarCollapsed ? "Expand sidebar" : "Collapse sidebar"}
        >
          {sidebarCollapsed ? (
            <ChevronRight
              size={18}
              className={darkMode ? "text-gray-300" : "text-gray-600"}
            />
          ) : (
            <ChevronLeft
              size={18}
              className={darkMode ? "text-gray-300" : "text-gray-600"}
            />
          )}
        </button>
      </div>

      {/* Right side - Controls and user */}
      <div className="flex items-center gap-3">
        {/* Dark mode toggle */}
        <button
          className={`p-1.5 rounded-full ${
            darkMode ? "hover:bg-gray-700" : "hover:bg-gray-100"
          } transition-colors duration-200`}
          onClick={() => setDarkMode(!darkMode)}
          aria-label={darkMode ? "Switch to light mode" : "Switch to dark mode"}
        >
          {darkMode ? (
            <Sun size={18} className="text-yellow-400" />
          ) : (
            <Moon size={18} className="text-gray-600" />
          )}
        </button>

        {/* Share button */}
        <button
          className={`p-1.5 rounded-full ${
            darkMode ? "hover:bg-gray-700" : "hover:bg-gray-100"
          } transition-colors duration-200`}
          aria-label="Share"
        >
          <Share
            size={18}
            className={darkMode ? "text-gray-300" : "text-gray-600"}
          />
        </button>

        {/* User avatar with dropdown */}
        <div className="relative group">
          <div className="flex items-center gap-2 cursor-pointer">
            <div
              className={`w-8 h-8 ${getUserColor()} rounded-full flex items-center justify-center text-white font-medium`}
              title={getDisplayName()}
            >
              {getUserInitial()}
            </div>
            {!sidebarCollapsed && (
              <span
                className={`text-sm ${
                  darkMode ? "text-gray-200" : "text-gray-700"
                }`}
              >
                {getDisplayName()}
              </span>
            )}
          </div>

          {/* Dropdown menu */}
          <div
            className={`absolute right-0 mt-2 w-48 rounded-md shadow-lg py-1 ${
              darkMode ? "bg-gray-700" : "bg-white"
            } hidden group-hover:block z-50`}
          >
            <a
              href="#"
              className={`block px-4 py-2 text-sm ${
                darkMode
                  ? "text-gray-200 hover:bg-gray-600"
                  : "text-gray-700 hover:bg-gray-100"
              }`}
            >
              Your Profile
            </a>
            <a
              href="#"
              className={`block px-4 py-2 text-sm ${
                darkMode
                  ? "text-gray-200 hover:bg-gray-600"
                  : "text-gray-700 hover:bg-gray-100"
              }`}
            >
              Settings
            </a>
            <a
              href="#"
              className={`block px-4 py-2 text-sm ${
                darkMode
                  ? "text-gray-200 hover:bg-gray-600"
                  : "text-gray-700 hover:bg-gray-100"
              }`}
            >
              Sign out
            </a>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
